def minPath(grid, k):
    n = len(grid)
    visited = [[False for _ in range(n)] for _ in range(n)]

    def dfs(i, j, path):
        if len(path) == k:
            return path

        visited[i][j] = True
        neighbors = [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]
        neighbors = [(x, y) for x, y in neighbors if 0 <= x < n and 0 <= y < n and not visited[x][y]]
        neighbors.sort(key=lambda x: grid[x[0]][x[1]])

        for x, y in neighbors:
            res = dfs(x, y, path + [grid[x][y]])
            if res:
                return res

        visited[i][j] = False
        return None

    for i in range(n):
        for j in range(n):
            path = dfs(i, j, [grid[i][j]])
            if path:
                return path

