        total += abs(num)
    return product * total

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, path):
        if len(path) == k:
            return path

        min_path = []
        for di, dj in directions:
            ni, nj = i + di, j + dj
            if 0 <= ni < n and 0 <= nj < n and (ni, nj) not in path:
                new_path = dfs(ni, nj, path + [(ni, nj)])
                if not min_path or new_path < min_path:
                    min_path = new_path

        return min_path

    min_val = min(min(row) for row in grid)
    start_positions = [(i, j) for i in range(n) for j in range(n) if grid[i][j] == min_val]

    result_path = []
    for start_pos in start_positions:
        result_path = min(result_path, dfs(start_pos[0], start_pos[1], [start_pos]))

    return [grid[i][j] for i, j in result_path]

def tri(n):
    if n == 0:
        return [0]
    elif n == 1:
        return [1, 1]
    else:
        tribonacci = [0, 1, 1]
        for i in range(3, n + 1):
            if i % 2 == 0:
                tribonacci.append(1 + i // 2)
            else:
                tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])
        return tribonacci

def digits(n):
    product = 1
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
        n //= 10
