def minPath(grid, k):
    n = len(grid)
    if not grid or n < 2:
        return []

    start = min(min(row) for row in grid)
    path = [start]
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, visited):
        if len(visited) == k:
            return True

        for dx, dy in directions:
            x, y = i + dx, j + dy
            if 0 <= x < n and 0 <= y < n and grid[x][y] not in visited:
                visited.add(grid[x][y])
                path.append(grid[x][y])
                if dfs(x, y, visited):
                    return True
                visited.remove(grid[x][y])
                path.pop()

        return False

    for i in range(n):
        for j in range(n):
            if grid[i][j] == start:
                if dfs(i, j, set([start])):
                    return path

