def minPath(grid, k):
    n = len(grid)
    visited = [[False for _ in range(n)] for _ in range(n)]

    def dfs(x, y, path):
        if x < 0 or x >= n or y < 0 or y >= n or visited[x][y]:
            return
        path.append(grid[x][y])
        visited[x][y] = True
        if len(path) == k:
            return path
        for dx, dy in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
            new_x, new_y = x + dx, y + dy
            res = dfs(new_x, new_y, path)
            if res:
                return res
        visited[x][y] = False
        path.pop()

    for i in range(n):
        for j in range(n):
            res = dfs(i, j, [])
            if res:
                return res

