def minPath(grid, k):
    n = len(grid)
    visited = [[False for _ in range(n)] for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= n or visited[i][j]:
            return None
        visited[i][j] = True
        path.append(grid[i][j])
        if len(path) == k:
            return path
        directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
        for dx, dy in directions:
            new_i, new_j = i + dx, j + dy
            new_path = dfs(new_i, new_j, path.copy())
            if new_path is not None:
                return new_path
        visited[i][j] = False
        return None

    for i in range(n):
        for j in range(n):
            path = dfs(i, j, [])
            if path is not None:
                return path

