def intersection(interval1, interval2):
    start = max(interval1[0], interval2[0])
    end = min(interval1[1], interval2[1])

    if start > end:
        return "NO"

    length = end - start + 1
    if length <= 1:
        return "NO"

    for i in range(2, int(length ** 0.5) + 1):
        if length % i == 0:
            return "NO"

    return "YES"

def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign = 1 if num > 0 else -1 if num < 0 else 0
        sign_product *= sign
        magnitude_sum += abs(num)
    return sign_product * magnitude_sum

def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    visited = set()

    def dfs(i, j, path):
        if len(path) == k:
            return path

        visited.add((i, j))
        min_val = float('inf')
        next_cell = None

        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            if 0 <= x < n and 0 <= y < m and (x, y) not in visited:
                if grid[x][y] < min_val:
                    min_val = grid[x][y]
                    next_cell = (x, y)

        return dfs(next_cell[0], next_cell[1], path + [grid[next_cell[0]][next_cell[1]]]) if next_cell else path

    start_val = min(min(row) for row in grid)
    start_coords = [(i, j) for i in range(n) for j in range(m) if grid[i][j] == start_val]

    result = dfs(start_coords[0][0], start_coords[0][1], [start_val])
    return result

def tri(n):
    if n == 0:
        return [0]
    if n == 1:
        return [1]

    tribonacci = [0, 1, 1]

    for i in range(3, n+1):
        if i % 2 == 0:
            tribonacci.append(1 + i // 2)
        else:
            tribonacci.append(tribonacci[i-1] + tribonacci[i-2] + tribonacci[i+1])

    return tribonacci

