def minPath(grid, k):
    n = len(grid)
    visited = [[False] * n for _ in range(n)]

    def dfs(i, j, path):
        if i < 0 or i >= n or j < 0 or j >= n or visited[i][j]:
            return
        path.append(grid[i][j])
        visited[i][j] = True
        if len(path) == k:
            return path
        for ni, nj in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            new_path = dfs(ni, nj, path.copy())
            if new_path:
                return new_path
        visited[i][j] = False

    for i in range(n):
        for j in range(n):
            path = dfs(i, j, [])
            if path:
                return path

