def encode(message):
    encoded_message = ""
    vowels = "aeiouAEIOU"

    for char in message:
        if char.isalpha():
            if char.lower() in vowels:
                char = chr((ord(char) + 2 - ord('a')) % 26 + ord('A')) if char.isupper() else chr((ord(char) + 2 - ord('a')) % 26 + ord('a'))
            else:
                char = char.upper() if char.islower() else char.lower()
        encoded_message += char

    return encoded_message

