def tri(n):
    if n == 0:
        return [0]
    elif n == 1:
        return [1, 1]
    elif n == 2:
        return [1, 1, 1]

    res = [1, 1, 1]
    for i in range(3, n + 1):
        if i % 2 == 0:
            res.append(1 + i // 2)
        else:
            res.append(res[-1] + res[-2] + res[-3])

    return res

