def int_to_mini_roman(number):
    roman_nums = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc',
        100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }
    result = ''
    for value, numeral in sorted(roman_nums.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result.lower()

def find_max(words):
    def count_unique_chars(word):
        return len(set(word))

    max_unique = 0
    max_word = ""

    for word in words:
        unique_chars = count_unique_chars(word)
        if unique_chars > max_unique or (unique_chars == max_unique and word < max_word):
            max_unique = unique_chars
            max_word = word

    return max_word

def do_algebra(operators, operands):
